porting signatures in an entry wasn\'t working<\\/li>\\n<\\/ul>\\n<h4>v2.02 - January 30, 2019<\\/h4>\\n<ul>\\n<li>Fix: Show the signature correctly in views and emails when Pro is running<\\/li>\\n<\\/ul>\\n<h4>v2.01 - January 16, 2019<\\/h4>\\n<ul>\\n<li>New: Give the signature field a face lift and show the field in the builder<\\/li>\\n<li>New: Show the typed option by default when javascript fails instead of showing nothing<\\/li>\\n<li>New: Don\'t clear the typed box when switching tabs<\\/li>\\n<li>Fix: The signature wasn\'t showing correctly in an email<\\/li>\\n<li>Fix: The signature field wasn\'t appearing for in-place edit<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 14, 2019<\\/h4>\\n<ul>\\n<li>New: The signature value immediately creates the image when the signature is saved and saves the url of the image for easier display. On update, all previous signatures are updated to the new format saved in the database.<\\/li>\\n<li>New: Add signature support for ajax forms and repeating sections.<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML.<\\/li>\\n<li>New: Use the 3.0 field object for better forward compatibility and lower baseline memory.<\\/li>\\n<li>New: Requires Formidable 3.0+<\\/li>\\n<li>New: Combine scripts into one file, and don\'t load IE8 fallback script in all browsers.<\\/li>\\n<li>New: Keep drawn signature when switching pages and when there are form validation errors.<\\/li>\\n<li>New: Allow signature editing in single-page form until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Prevent error message when Formidable is disabled<\\/li>\\n<li>Fix: Show the signature image with https when needed<\\/li>\\n<li>Fix: The hide tabs options weren\'t saving since v3.0<\\/li>\\n<\\/ul>\\n<h4>v2.0b1 - December 7, 2017<\\/h4>\\n<ul>\\n<li>New: Add signature support with ajax forms and repeating sections<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML<\\/li>\\n<li>Fix: Keep drawn signature when switching pages.<\\/li>\\n<li>Fix: Keep drawn signature present when there are form errors.<\\/li>\\n<li>Fix: Allow signature editing until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Resolve error message when Formidable is disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-signature\\/signature.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"310430\":{\"title\":\"Stripe\",\"name\":\"Stripe\",\"slug\":\"stripe\",\"version\":\"2.02\",\"new_version\":\"2.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-stripe\\/formidable-stripe-2.02.zip\"],\"excerpt\":\"Any Formidable forms on your site can accept credit card payments without users ever leaving your site.\",\"id\":310430,\"released\":\"2016-04-26 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/stripe\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/stripe\\/\",\"changelog\":\"<h4>v2.02 - March 9, 2020<\\/h4>\\n<ul>\\n<li>Update the Stripe library.<\\/li>\\n<li>New: Include the first and last name on a newly created customer.<\\/li>\\n<li>Fix: If a payment attempt failed after the entry was created, the credit card field was hidden and couldn\'t be updated.<\\/li>\\n<li>Fix: The previous button on the same page as a credit card field wasn\'t doing anything.<\\/li>\\n<li>Fix: Payments weren\'t being collected correctly in Internet Explorer.<\\/li>\\n<li>Fix: The refund button was returning a \\\"Failed\\\" message with some payments.<\\/li>\\n<li>Fix: When the font-family setting included incorrect characters, the credit card field wasn\'t displayed.<\\/li>\\n<li>Fix: Some error messages were being bypassed like strong password and invisible recaptcha.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - September 19, 2019<\\/h4>\\n<ul>\\n<li>New: Hide the Zip\\/Postal code. It\'s not a great user experience, and isn\'t necessary.<\\/li>\\n<li>Fix: Trigger database install or upgrade when activated site wide in WP multisite.<\\/li>\\n<li>Fix: Prevent a fatal error with undefined function on some sites.<\\/li>\\n<li>Fix: Prevent issues with a subsequent payment when customer is deleted in Stripe.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 9, 2019<\\/h4>\\n<ul>\\n<li>New: Add support for SCA, Stripe elements, and Secure 3d Payments. More styling for the new credit card field is coming with Formidable v4.02.04.<\\/li>\\n<li>New: Set the locale for the credit card field and instant error messages.<\\/li>\\n<li>New: Add option in payment form actions to authorize one-time payments without capture.<\\/li>\\n<li>New: Include an option to process one-time payments before the entry is created.<\\/li>\\n<li>New: Add minified javascript.<\\/li>\\n<li>Reverse the order of private and public keys to match Stripe account page.<\\/li>\\n<li>Hide settings in credit card field in forms with Stripe including sub field descriptions, placeholders, and options to save card info. These are no longer used with the more secure credit card field.<\\/li>\\n<li>Switch to Stripe js v3<\\/li>\\n<li>Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: some API versions were returning an error when canceling a subscription.<\\/li>\\n<li>Update form action icon<\\/li>\\n<li>Remove incorrect edit link for a subscription<\\/li>\\n<li>Fix error with wrong class name \\\"FrmTransSubscriptionsController\\\"<\\/li>\\n<li>Remove usage of deprecated FrmDb class<\\/li>\\n<\\/ul>\\n<h4>v2.0b2 - September 7, 2019<\\/h4>\\n<ul>\\n<li>Add option in payment form actions to authorize one-time payments without capture.<\\/li>\\n<li>Set the locale for the credit card field including error messages.<\\/li>\\n<li>Reverse the order of private and public keys to match Stripe account page.<\\/li>\\n<li>Hide settings in credit card field in forms with Stripe including sub field descriptions, placeholders, and options to save card info.<\\/li>\\n<li>Fix: Prevent 403 errors on return from Secure 3D approval by generating the success message on return.<\\/li>\\n<\\/ul>\\n<h4>v2.0b - September 2, 2019<\\/h4>\\n<ul>\\n<li>New: Add support for SCA, Stripe elements, and Secure 3d Payments.<\\/li>\\n<li>New: Include an option to process one-time payments before the entry is created.<\\/li>\\n<li>New: Add minified javascript.<\\/li>\\n<li>Switch to Stripe js v3.<\\/li>\\n<li>Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: some API versions were returning an error when canceling a subscription.<\\/li>\\n<li>Update form action icon<\\/li>\\n<li>Remove incorrect edit link for a subscription<\\/li>\\n<li>Fix error with wrong class name \\\"FrmTransSubscriptionsController\\\"<\\/li>\\n<li>Remove usage of deprecated FrmDb class<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-stripe\\/formidable-stripe.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168460\":{\"title\":\"Twilio\",\"name\":\"Twilio\",\"slug\":\"twilio\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-twilio\\/formidable-twilio-1.08.zip\"],\"excerpt\":\"Allow users to text their votes for polls created by Formidable Forms, or send SMS notifications when entries are submitted or updated.\",\"id\":168460,\"released\":\"2014-03-10 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/twilio-add-on\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/twilio\\/\",\"changelog\":\"<h4>v1.08 - January 16, 2017<\\/h4>\\n<ul>\\n<li>Improved: Removed deprecated instructions and screenshot.<\\/li>\\n<li>Improved: Removed deprecated valign attribute from table HTML.<\\/li>\\n<\\/ul>\\n<h4>v1.07 - November 1, 2016<\\/h4>\\n<ul>\\n<li>When an SMS message is received, run validation and respond with a text that includes any error messages<\\/li>\\n<li>When a text is received successfully, respond with the form success message, filtered list like a form does.<\\/li>\\n<li>Allow for the \\\"other\\\" fields to be filled from a text submission<\\/li>\\n<li>Check if license number is for correct plugin<\\/li>\\n<li>Don\'t try to send messages to a blank number<\\/li>\\n<\\/ul>\\n<h4>v1.06 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_format_number filter for formatting the phone number before it\'s sent to Twilio<\\/li>\\n<li>Fix license activation<\\/li>\\n<\\/ul>\\n<h4>v1.05 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_sms_response hook for changing the message in the text<\\/li>\\n<li>Allow for 8-digit numbers. +65 phone numbers were having trouble because we assumed they should be US numbers. Now if the number starts with a +, don\'t add the +1<\\/li>\\n<li>Get updates from FormidableForms.com<\\/li>\\n<\\/ul>\\n<h4>v1.04 - September 11, 2015<\\/h4>\\n<ul>\\n<li>Fix error with accepting votes<\\/li>\\n<li>Send a response when a text vote is received<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-twilio\\/formidable-twilio.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168456\":{\"title\":\"Upload Importer\",\"name\":\"Upload Importer\",\"slug\":\"upload-importer\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"