INSERT INTO `wp_wfissues` VALUES (8,1585299771,1585299771,'new','skippedPaths',25,'6fd0d290b978eab8027e6b79501ac149','6fd0d290b978eab8027e6b79501ac149','1 path was skipped for the malware scan due to scan settings','The option \"Scan files outside your WordPress installation\" is off by default, which means 1 path and its file(s) will not be scanned for malware or unauthorized changes. To continue skipping this path, you may ignore this issue. Or to start scanning it, enable the option and subsequent scans will include it. Some paths may not be necessary to scan, so this is optional. <a href=\"https://www.wordfence.com/help/?query=scan-result-skipped-paths\" target=\"_blank\" rel=\"noopener noreferrer\">Learn More</a><br><br>The path skipped is ~/.git','a:0:{}'),(20,1585686514,1585686514,'new','wfPluginUpgrade',50,'a2a362f6d836e1730b9d49000992a76b','a2a362f6d836e1730b9d49000992a76b','The Plugin \"Akismet Anti-Spam\" needs an upgrade (4.1.3 -> 4.1.4).','You need to upgrade \"Akismet Anti-Spam\" to the newest version to ensure you have any security fixes the developer has released.','a:20:{s:21:\"EVF requires at least\";s:0:\"\";s:16:\"EVF tested up to\";s:0:\"\";s:4:\"Name\";s:17:\"Akismet Anti-Spam\";s:9:\"PluginURI\";s:20:\"https://akismet.com/\";s:7:\"Version\";s:5:\"4.1.3\";s:11:\"Description\";s:363:\"Used by millions, Akismet is quite possibly the best way in the world to <strong>protect your blog from spam</strong>. It keeps your site protected even while you sleep. To get started: activate the Akismet plugin and then go to your Akismet Settings page to set up your API key. <cite>By <a href=\"https://automattic.com/wordpress-plugins/\">Automattic</a>.</cite>\";s:6:\"Author\";s:66:\"<a href=\"https://automattic.com/wordpress-plugins/\">Automattic</a>\";s:9:\"AuthorURI\";s:41:\"https://automattic.com/wordpress-plugins/\";s:10:\"TextDomain\";s:7:\"akismet\";s:10:\"DomainPath\";s:0:\"\";s:7:\"Network\";b:0;s:10:\"RequiresWP\";s:0:\"\";s:11:\"RequiresPHP\";s:0:\"\"